import { UserContext } from '../context/User';


const History = () => {
    const { user, setUser } = useContext(UserContext);

    
  return (
    <section>
      <div className="hero-body mt-5">
        <div className='container'>
          
            <p>Test</p>
            <h1>Current user id: {user}</h1>   
          

        </div>
 
      </div>
    </section>


  )
}

export default History
